import React, { Component } from 'react';

class SitterReview extends Component {
    render() {
        return (
            <div>
                후기가 좋은 사람들을 우선 보여준다(가까운 지역 우선으로)
                내가 받은 후기
                내가 등록한 후기
            </div>
        );
    }
}

export default SitterReview;
